  const patientId = sessionStorage.getItem("userId");

  useEffect(() => {
    ShowAppointment();
  }, []);

  // const handleInputChange = (event) => {
  //   const { name, value } = event.target;
  //   setFormData({
  //     ...formData,
  //     [name]: value,
  //   });
  // };

  const ShowAppointment =  () => {
    // event.preventDefault(); // Prevent default form submission behavior
    const url = createUrl(`/appoinment/${patientId}`);
    //console.log(selectedDoctor);
    debugger;
      axios.get(url)
      .then(function(response){
        setAppointment(response.data);
      //  setLoading(false);
        log(response);
      })
      . catch(function(error){
        log(error);
      })
      console.log("Appointment booked are:", response.data);
      toast.success("Appointment fetch successfully");
    
  };

  return (
    <div>
      <Helmet title="Doctor">
        <CommonSection title="Doctor List" />
        <section>
          <Container>
            <Table striped>
              <thead>
                <tr>
                  <th>Patient Name</th>
                  <th>patient Age</th>
                  <th>Reletion</th>
                  <th>Schedule Date</th>
                  <th>Schedule Time</th>
                  <th>Payment Ammount</th>
                </tr>
              </thead>
              <tbody>
                {appointment.map((appointment, index) => (
                  <AppointmentItem key={index} appointments={appointment} />
                ))}
              </tbody>
            </Table>
          </Container>
        </section>
      </Helmet>
    </div>
  );
};

export default AppointmentListing;

